import React, { useState, useEffect } from 'react';
import { 
  ComputerDesktopIcon, 
  PlayIcon,
  StopIcon,
  ExclamationTriangleIcon,
  CheckCircleIcon,
  ClockIcon,
  ArrowPathIcon,
  ChartBarIcon,
  CpuChipIcon,
  CircleStackIcon,
  ArrowUpIcon,
  ArrowDownIcon,
  ShieldCheckIcon,
  XCircleIcon,
  BoltIcon,
  EyeIcon,
  SparklesIcon,
  CurrencyDollarIcon,
  ShoppingCartIcon,
  ChatBubbleLeftRightIcon,
  ArrowTrendingUpIcon
} from '@heroicons/react/24/outline';

interface AgentExecution {
  id: string;
  agentName: string;
  operation: string;
  status: 'running' | 'completed' | 'stopped' | 'failed';
  startTime: Date;
  duration: number;
  dataProcessed: number;
}

interface DataOperation {
  id: string;
  table: string;
  operation: 'INSERT' | 'SELECT' | 'UPDATE' | 'DELETE';
  recordsAffected: number;
  timestamp: Date;
  agent: string;
}

interface MonitoringAlert {
  id: string;
  agentName: string;
  reason: string;
  timestamp: Date;
  severity: 'low' | 'medium' | 'high';
}

const AdminMonitoringDashboard: React.FC = () => {
  const [executions, setExecutions] = useState<AgentExecution[]>([]);
  const [dataOps, setDataOps] = useState<DataOperation[]>([]);
  const [alerts, setAlerts] = useState<MonitoringAlert[]>([]);
  const [isSimulating, setIsSimulating] = useState(true);

  const agentNames = [
    'InventoryAgent', 'PricingAgent', 'CustomerServiceAgent', 'RecommendationAgent',
    'DataAnalysisAgent', 'MarketingAgent', 'FinancialAnalystAgent', 'SEOAgent', 'SupplyChainAgent'
  ];

  const operations = [
    'Analyzing inventory levels', 'Processing customer data', 'Optimizing pricing strategy',
    'Generating recommendations', 'Updating product catalog', 'Processing orders',
    'Analyzing market trends', 'Optimizing supply chain', 'Managing customer queries',
    'Forecasting demand', 'Calculating ROI', 'SEO optimization'
  ];

  const tables = ['products', 'orders', 'customers', 'inventory', 'analytics', 'pricing', 'recommendations'];

  const agentIcons: { [key: string]: React.ComponentType<any> } = {
    'InventoryAgent': ShoppingCartIcon,
    'PricingAgent': CurrencyDollarIcon,
    'CustomerServiceAgent': ChatBubbleLeftRightIcon,
    'RecommendationAgent': SparklesIcon,
    'DataAnalysisAgent': ChartBarIcon,
    'MarketingAgent': BoltIcon,
    'FinancialAnalystAgent': CurrencyDollarIcon,
    'SEOAgent': EyeIcon,
    'SupplyChainAgent': ArrowTrendingUpIcon,
  };

  const generateExecution = (): AgentExecution => {
    const agent = agentNames[Math.floor(Math.random() * agentNames.length)];
    const operation = operations[Math.floor(Math.random() * operations.length)];

    return {
      id: `exec-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
      agentName: agent,
      operation,
      status: 'running',
      startTime: new Date(),
      duration: 0,
      dataProcessed: Math.floor(Math.random() * 1000) + 100
    };
  };

  const generateDataOperation = (agent: string): DataOperation => {
    const operations = ['INSERT', 'SELECT', 'UPDATE', 'DELETE'] as const;
    const table = tables[Math.floor(Math.random() * tables.length)];
    const operation = operations[Math.floor(Math.random() * operations.length)];

    return {
      id: `data-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
      table,
      operation,
      recordsAffected: Math.floor(Math.random() * 500) + 1,
      timestamp: new Date(),
      agent
    };
  };

  const generateAlert = (agentName: string): MonitoringAlert => {
    const reasons = [
      'High CPU usage detected',
      'Memory threshold exceeded',
      'Unusual data access pattern',
      'Rate limit approaching',
      'Anomalous behavior detected',
      'Security policy violation'
    ];

    const severities = ['low', 'medium', 'high'] as const;

    return {
      id: `alert-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
      agentName,
      reason: reasons[Math.floor(Math.random() * reasons.length)],
      timestamp: new Date(),
      severity: severities[Math.floor(Math.random() * severities.length)]
    };
  };

  useEffect(() => {
    if (!isSimulating) return;

    const interval = setInterval(() => {
      // Add new executions (about every 2-5 seconds)
      if (Math.random() < 0.4) {
        const newExecution = generateExecution();
        setExecutions(prev => [newExecution, ...prev.slice(0, 19)]); // Keep last 20
      }

      // Update existing executions
      setExecutions(prev => prev.map(exec => {
        if (exec.status === 'running') {
          const newDuration = exec.duration + 1;

          // 5% chance of being stopped by monitoring
          if (Math.random() < 0.05) {
            const alert = generateAlert(exec.agentName);
            setAlerts(prevAlerts => [alert, ...prevAlerts.slice(0, 9)]); // Keep last 10
            return { ...exec, status: 'stopped', duration: newDuration };
          }

          // Complete after 10-30 seconds
          if (newDuration > 10 + Math.random() * 20) {
            // Generate data operations when completing
            const numOps = Math.floor(Math.random() * 3) + 1;
            for (let i = 0; i < numOps; i++) {
              setTimeout(() => {
                const dataOp = generateDataOperation(exec.agentName);
                setDataOps(prev => [dataOp, ...prev.slice(0, 49)]); // Keep last 50
              }, i * 200);
            }

            return { ...exec, status: 'completed', duration: newDuration };
          }

          return { ...exec, duration: newDuration };
        }
        return exec;
      }));
    }, 1000);

    return () => clearInterval(interval);
  }, [isSimulating]);

  const runningExecutions = executions.filter(e => e.status === 'running');
  const completedExecutions = executions.filter(e => e.status === 'completed');
  const stoppedExecutions = executions.filter(e => e.status === 'stopped');

  const recentDataOps = dataOps.slice(0, 10);
  const recentAlerts = alerts.slice(0, 5);

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      {/* Header */}
      <div className="mb-8">
        <div className="flex items-center justify-between">
          <div>
            <div className="flex items-center space-x-3 mb-4">
              <ComputerDesktopIcon className="h-8 w-8 text-primary-600" />
              <h1 className="text-3xl font-bold text-gray-900">Agent Monitoring Dashboard</h1>
            </div>
            <p className="text-gray-600">
              Real-time monitoring of AI agent executions and system operations
            </p>
          </div>

          <div className="flex space-x-3">
            <button
              onClick={() => setIsSimulating(!isSimulating)}
              className={`btn ${isSimulating ? 'btn-secondary' : 'btn-primary'}`}
            >
              {isSimulating ? (
                <>
                  <StopIcon className="h-5 w-5 mr-2" />
                  Stop Simulation
                </>
              ) : (
                <>
                  <PlayIcon className="h-5 w-5 mr-2" />
                  Start Simulation
                </>
              )}
            </button>
          </div>
        </div>
      </div>

      {/* Stats Overview */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        <div className="card">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-600">Running</p>
              <p className="text-3xl font-bold text-green-600">{runningExecutions.length}</p>
            </div>
            <PlayIcon className="h-8 w-8 text-green-600" />
          </div>
        </div>

        <div className="card">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-600">Completed</p>
              <p className="text-3xl font-bold text-blue-600">{completedExecutions.length}</p>
            </div>
            <CheckCircleIcon className="h-8 w-8 text-blue-600" />
          </div>
        </div>

        <div className="card">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-600">Stopped</p>
              <p className="text-3xl font-bold text-red-600">{stoppedExecutions.length}</p>
            </div>
            <XCircleIcon className="h-8 w-8 text-red-600" />
          </div>
        </div>

        <div className="card">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-600">Data Ops</p>
              <p className="text-3xl font-bold text-purple-600">{dataOps.length}</p>
            </div>
            <CircleStackIcon className="h-8 w-8 text-purple-600" />
          </div>
        </div>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
        {/* Active Executions */}
        <div className="card">
          <div className="flex items-center justify-between mb-6">
            <h3 className="text-lg font-semibold text-gray-900">Active Executions</h3>
            <div className="flex items-center space-x-2">
              <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
              <span className="text-sm text-gray-500">Live</span>
            </div>
          </div>

          <div className="space-y-3 max-h-96 overflow-y-auto">
            {runningExecutions.length === 0 ? (
              <p className="text-gray-500 text-center py-8">No active executions</p>
            ) : (
              runningExecutions.map((exec) => {
                const IconComponent = agentIcons[exec.agentName] || CpuChipIcon;
                return (
                  <div key={exec.id} className="flex items-center justify-between p-3 bg-green-50 rounded-lg border border-green-200">
                    <div className="flex items-center space-x-3">
                      <IconComponent className="h-5 w-5 text-green-600" />
                      <div>
                        <p className="font-medium text-gray-900">{exec.agentName}</p>
                        <p className="text-sm text-gray-600">{exec.operation}</p>
                      </div>
                    </div>
                    <div className="text-right">
                      <div className="flex items-center space-x-2">
                        <ArrowPathIcon className="h-4 w-4 text-green-600 animate-spin" />
                        <span className="text-sm font-medium text-green-600">{exec.duration}s</span>
                      </div>
                      <p className="text-xs text-gray-500">{exec.dataProcessed} records</p>
                    </div>
                  </div>
                );
              })
            )}
          </div>
        </div>

        {/* Recent Data Operations */}
        <div className="card">
          <div className="flex items-center justify-between mb-6">
            <h3 className="text-lg font-semibold text-gray-900">Database Operations</h3>
            <CircleStackIcon className="h-5 w-5 text-gray-400" />
          </div>

          <div className="space-y-2 max-h-96 overflow-y-auto">
            {recentDataOps.length === 0 ? (
              <p className="text-gray-500 text-center py-8">No recent operations</p>
            ) : (
              recentDataOps.map((op) => (
                <div key={op.id} className="flex items-center justify-between p-2 hover:bg-gray-50 rounded">
                  <div className="flex items-center space-x-3">
                    <div className={`px-2 py-1 rounded text-xs font-medium ${
                      op.operation === 'INSERT' ? 'bg-green-100 text-green-800' :
                      op.operation === 'SELECT' ? 'bg-blue-100 text-blue-800' :
                      op.operation === 'UPDATE' ? 'bg-yellow-100 text-yellow-800' :
                      'bg-red-100 text-red-800'
                    }`}>
                      {op.operation}
                    </div>
                    <span className="text-sm font-medium">{op.table}</span>
                    <span className="text-xs text-gray-500">by {op.agent}</span>
                  </div>
                  <div className="text-right">
                    <p className="text-sm font-medium">{op.recordsAffected}</p>
                    <p className="text-xs text-gray-500">
                      {op.timestamp.toLocaleTimeString()}
                    </p>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>
      </div>

      {/* Monitoring Alerts and Recent Executions */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 mt-8">
        {/* Monitoring Alerts */}
        <div className="card">
          <div className="flex items-center justify-between mb-6">
            <h3 className="text-lg font-semibold text-gray-900">Monitoring Alerts</h3>
            <ShieldCheckIcon className="h-5 w-5 text-gray-400" />
          </div>

          <div className="space-y-3 max-h-96 overflow-y-auto">
            {recentAlerts.length === 0 ? (
              <div className="text-center py-8">
                <CheckCircleIcon className="h-12 w-12 text-green-400 mx-auto mb-2" />
                <p className="text-green-600 font-medium">All systems operating normally</p>
              </div>
            ) : (
              recentAlerts.map((alert) => (
                <div key={alert.id} className={`p-3 rounded-lg border-l-4 ${
                  alert.severity === 'high' ? 'bg-red-50 border-red-400' :
                  alert.severity === 'medium' ? 'bg-yellow-50 border-yellow-400' :
                  'bg-blue-50 border-blue-400'
                }`}>
                  <div className="flex items-start justify-between">
                    <div>
                      <div className="flex items-center space-x-2">
                        <ExclamationTriangleIcon className={`h-4 w-4 ${
                          alert.severity === 'high' ? 'text-red-600' :
                          alert.severity === 'medium' ? 'text-yellow-600' :
                          'text-blue-600'
                        }`} />
                        <span className="font-medium text-gray-900">{alert.agentName}</span>
                        <span className={`px-2 py-1 rounded-full text-xs font-medium ${
                          alert.severity === 'high' ? 'bg-red-100 text-red-800' :
                          alert.severity === 'medium' ? 'bg-yellow-100 text-yellow-800' :
                          'bg-blue-100 text-blue-800'
                        }`}>
                          {alert.severity.toUpperCase()}
                        </span>
                      </div>
                      <p className="text-sm text-gray-600 mt-1">{alert.reason}</p>
                    </div>
                    <span className="text-xs text-gray-500">
                      {alert.timestamp.toLocaleTimeString()}
                    </span>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>

        {/* Execution History */}
        <div className="card">
          <div className="flex items-center justify-between mb-6">
            <h3 className="text-lg font-semibold text-gray-900">Recent Executions</h3>
            <ClockIcon className="h-5 w-5 text-gray-400" />
          </div>

          <div className="space-y-2 max-h-96 overflow-y-auto">
            {executions.slice(0, 10).map((exec) => {
              const IconComponent = agentIcons[exec.agentName] || CpuChipIcon;
              return (
                <div key={exec.id} className="flex items-center justify-between p-2 hover:bg-gray-50 rounded">
                  <div className="flex items-center space-x-3">
                    <IconComponent className="h-4 w-4 text-gray-400" />
                    <div>
                      <p className="text-sm font-medium">{exec.agentName}</p>
                      <p className="text-xs text-gray-500">{exec.operation}</p>
                    </div>
                  </div>
                  <div className="text-right">
                    <div className="flex items-center space-x-2">
                      {exec.status === 'running' && (
                        <ArrowPathIcon className="h-3 w-3 text-green-600 animate-spin" />
                      )}
                      {exec.status === 'completed' && (
                        <CheckCircleIcon className="h-3 w-3 text-green-600" />
                      )}
                      {exec.status === 'stopped' && (
                        <XCircleIcon className="h-3 w-3 text-red-600" />
                      )}
                      <span className={`text-xs font-medium ${
                        exec.status === 'running' ? 'text-green-600' :
                        exec.status === 'completed' ? 'text-blue-600' :
                        'text-red-600'
                      }`}>
                        {exec.status}
                      </span>
                    </div>
                    <p className="text-xs text-gray-500">{exec.duration}s</p>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminMonitoringDashboard;
